export const COLUMNS = [
  {
    Header: "Common Name",
    accessor: 'comName',
    Cell: props => {

      return (
        <ComNameCell onClick={e=> {const ebird_redirect = `https://ebird.org/species/${cell.id.value}`;
        window.open(ebird_redirect);
        console.log('click')}}/>
      )
    }
  },
  {
      Header: "Scientific Name",
      accessor: 'sciName'
  },
  {
      Header: "Location",
      accessor: 'locName'
  },
  {
      Header: "Date",
      accessor: 'obsDt'
  }
];
